
using System;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;
using PostApi.Models;
using RecipeApi.Models;

namespace PostApi.Data
{
    public class UserContext : IdentityDbContext
    {
        public UserContext(DbContextOptions<UserContext> options) : base(options)
        {

        }

        protected override void OnModelCreating(ModelBuilder builder)
        {

            base.OnModelCreating(builder);
            builder.Entity<User>()
                .HasMany(u => u.Posts)
                .WithOne()
                .IsRequired()
                .HasForeignKey(u => u.UserId);

            builder.Entity<Post>().HasKey(post => post.Id);
        
            builder.Entity<User>().HasData(
                 new User { Id= 1, Name = "Ahmad", Password= "ahmad", Location = "Gent" },
                 new User {Id = 2, Name = "yaser",Password = "yaser", Location = "Brugge"},
                 new User { Id = 3, Name = "omar", Password = "omar", Location = "Brugge" },
                 new User { Id = 4, Name = "ammar", Password = "ammar", Location = "Brussel" }
  );

            builder.Entity<Post>().HasData(
                    //Shadow property can be used for the foreign key, in combination with anaonymous objects
                    new { Id = 1, Title = "Bienenstich", UserId = 1, Location = "Gent" , Date = DateTime.Today,
                        Picture = "data:image/jpeg;base64,",
                        Reserved = false
                    },
                    new { Id = 2, Title = "Kalter Hund", UserId = 1, Location = "Hasselt", Date = DateTime.Today.AddDays(-2),
                    Picture = "data:image/jpeg;base64,",
                        Reserved = false

                    },
                    new
                    {
                        Id = 3,
                        Title = "Lebkuchen",
                        UserId = 1,
                        Location = "Brugge",
                        Date = DateTime.Now,
                        Picture = "data:image/jpeg;base64,",
                        Reserved = false
                    }

                 );
        }

        public DbSet<User> Users { get; set; }
        public DbSet<Post> Posts { get; set; }
    }

}
